【ロージーローザ クレンジング綿棒の詳細】<br>
●先細タイプの綿棒にクレンジングがしみこませてある部分用メイク落とし。<br>
●もう片方の綿球は拭き取りにも便利なドライタイプになっています。<br><br>

【使用方法】<br>
1.個包装は中央のミシン目に沿って開けてください。<br>
2.修正したい部分を優しくなぞります。<br>
3.乾いた方のコットンでオイルを拭き取ります。<br><br>

【ご注意】<br>
○化粧用以外のご使用はお避けください。<br>
○先がとがっている部分がありますので、取り扱いには十分ご注意ください。<br>
○目に入らないようご注意ください。<br>
○傷口やしっしん等、異常のある部位にはご使用にならないでください。<br>
○万一身体に異常を感じた場合には、使用を中止し、医師にご相談ください。<br>
○手を清潔にして、綿球部分に触れないようにご使用ください。<br>
○個包装を開封後は、早めにお使いください。一度お使いになった綿棒の再使用はお止めください。<br>
○湿度の高い場所、直射日光のあたる場所を避け、お子様の手の届かない清潔な場所に保管してください。<br><br>

【材質】<br><br>
綿球／脱脂綿、軸／ポリプロピレン、全成分／ミネラルオイル、イソステアリルアルコール、トリイソステアリン酸PEG－20グリセリル、テトラオレイン酸ソルベス－30、オレンジ油、フェノキシエタノール<br><br>

【内容量】<br>
25本入<br><br>

【販売元】<br>
株式会社シャンティ<br>
東京都新宿区市谷本町1-1<br>
お電話：0120-56-1114<br><br>

【商品区分】<br>
化粧品<br><br>

