【マジラボ フェイスライン整形テープ 強力タイプ トライアル MG22125の詳細】<br>
●速効引き上げ！<br>
●メイクの上からでも、しっかり貼れる！<br>
●強力タイプ フェイスライン整形テープ。<br>
●初めての方に トライアル30枚入り。<br><br>

【使用方法】<br>
STEP.1 まずは、手の甲で練習します<br>
1.台紙の下から持ち手を押し出します。<br>
2.持ち手を持って、台紙からテープをはがします。<br>
3.手の甲にのせて、貼った部分「1」を押さえます。<br>
4.持ち手を引っ張って、台紙をはがしながら「2」を押さえます。<br>
5.テープだけがのこります。<br>
STEP.2 リフトアップする位置を探します<br>
鏡をみながら指で皮フを矢印の方向に引き上げて、最もリフトアップする位置をみつけます。<br>
STEP.3 肌表面の皮脂を軽く拭き取ります<br>
事前に、貼る部分の皮脂を、あぶら取り紙ティッシュなどで軽く拭き取っていただくと綺麗に貼付けられます。貼付けたあとにファンデーションを塗ることもできますが、テープの段差が目立つ場合がありますので、その都度鏡で確認しながら薄く塗り重ねることをおすすめします。<br><br>

整形テープ(強力タイプ)の貼り方：STEP.2で決めた位置にテープを貼ります。<br>
整形テープ(強力タイプ)のはがし方：コットンにクレンジングオイルなどを湿らせて、テープの端を軽くこすります。テープの先端が浮いてきますので、そこからゆっくりはがしてください。<br><br>

【ご注意】<br>
○本来の用途以外には使用しないでください。<br>
○お肌の弱い方、アレルギー体質の方や、皮フに異常のあるときは使用しないでください。<br>
○お肌に異常のあるときは使用しないでください。<br>
○かぶれ、ただれ、赤み、発疹等、異常が現れたときは使用を中止し、皮フ科専門医等に相談してください。<br>
○長時間同じところに貼り続けたり、強く押しつけると皮フの炎症や思わぬケガをすることがありますのでご注意ください。<br>
○傷やただれがある場所に直接つけないようにご注意ください。<br>
○異常を感じたときは、ただちに使用を中止してください。<br>
○激しい運動や就寝時は使用しないでください。思わぬケガをする恐れがあります。<br>○お子様の手の届かないところに保管してください。<br>
○火気の近くや直射日光の当たるところ、高温多湿になる場所を避けて保管してください。<br><br>

